  \"Prescription grazing and waterfowl nest dragging : Their effects on neotropical
  birds : A four year report : Audubon Complex\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-10-08T15:56:09.723676\",\n\t\"name\": \"prescription-grazing-and-waterfowl-nest-dragging-their-effects-on-neotropical-birds-a-four\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 1990 a ten year monitoring program on
  Audubon National Wildlife Refuge and Audubon Wetland Management District was initiated
  to study wildlife effects on the following land management practices: 1) Prescription
  Burning - burning conducted early spring before green up: 2) Haying - haying conducted
  after July 15: 3) Spring Crowd Grazing - 30 day early spring grazing (usually May)
  125% of recommended NRCS (National Resource Conservation Service) guidelines: 4)
  Prescription Grazing - grazing rates vary for desired vegetative impacts: 5) Rest
  - all areas rested 3 to 4 years or more ( except for Prescription Grazing Areas)
  between treatments 1 through 3 above: The following censusing techniques were/are
  being implemented (the initial monitoring program emphasized waterfowl nesting and
  vegetative density): 1) Vegetative transects - robel measurements (conducted every
  year): 2) Photo points of selected vegetative points ( conducted every year): 3)
  Chain nest dragging for waterfowl nests, upland game birds, and other bird nests
  (two nest drags conducted every year): 4) Video points ( conducted since 1991):
  5) Random bird inventory ( conducted 1992 thru 1994): 6) Predator use of the areas
  ( conducted 1990 thru 1994): 7) Point Count Censusing for Neotropical Bird Species
  ( conducted 1994 thru 1997): The following report is in the 8th year of the 1 O
  year program. Enough data has been collected to warrant a summary of our findings,
  and to give some preliminary conclusions. This report will mainly cover the Point
  Count Censusing for Neotropical Bird Species.\",\n\t\"license_title\": \"License
